import React from 'react';
import styles from './RemedyDetails.module.css'

const RemedyDetails = ({ remedyData }) => {

    function convertKeysToLowerCase(obj) {
        if (typeof obj !== "object" || obj === null) {
          return obj; // Return unchanged if not an object
        }
      
        // If obj is an array, map over its elements and recursively convert keys to lowercase
        if (Array.isArray(obj)) {
          return obj.map(item => convertKeysToLowerCase(item));
        }
      
        // Create a new object to store the converted keys
        const newObj = {};
        for (let key in obj) {
          if (Object.prototype.hasOwnProperty.call(obj, key)) {
            // Recursively convert nested objects
            newObj[key.toLowerCase()] = convertKeysToLowerCase(obj[key]);
          }
        }
        return newObj;
      }

      re

      return (
        <div>
          <h1>{remedyData.Diagnosis}</h1>
          <h2>What to eat:</h2>
          <ul>
            {whatToEatSearchResult.map((item, index) => (
              <li key={index}>
                <strong>{item.Food}:</strong> {item.Reason}
              </li>
            ))}
          </ul>
          
          <h2>How to prepare it:</h2>
          <ul>
            {howToPrepareItSearchResult.map((item, index) => (
              <li key={index}>
                <strong>{item.Food}:</strong> {item.Preparation}
              </li>
            ))}
          </ul>
  
          <h2>When to eat:</h2>
          <ul>
            {whenToEatSearchResult.map((item, index) => (
              <li key={index}>
                <strong>{item.Time}:</strong> {item.Meal}
              </li>
            ))}
          </ul>
        </div>
      );
};

export default RemedyDetails;
